export enum IconsEnum {
    BlockChainIcon = 'BlockChainIcon',
    GraphqlIcon = 'GraphqlIcon',
    MongoDBIcon = 'MongoDBIcon',
    NetjsIcon = 'NetjsIcon',
    NodeIcon = 'NodeIcon',
    ReactIcon = 'ReactIcon',
    TypescriptIcon = 'TypescriptIcon',
    I18nIcon = 'I18nIcon',
    FireBaseIcon = 'FireBaseIcon',
    NestJSIcon = 'NestJSIcon',
    MaterialUiIcon = 'MaterialUiIcon',
    ThreeJSIcon = 'ThreeJSIcon',
    TalwindIcon = 'TalwindIcon',
    EthersJsIcon = 'EthersJsIcon',
    FramerMotionIcon = 'FramerMotionIcon',
    HardHatIcon = 'HardHatIcon',
    WalletConnectIcon = 'WalletConnectIcon',
    GitHub = 'GitHub',
    Linkedin = 'Linkedin',
    Email = 'Email',
    Engine = 'Engine',
    Mobile = 'Mobile',
    WebApps = 'WebApps'
}

export const CustomIcon = (iconsEnum?: IconsEnum | string, fill?: string, height?: number | string, width?: number | string, fill2?: string) => {
    switch (iconsEnum) {
        case IconsEnum.BlockChainIcon:
            return <BlockChainIcon fill={fill} height={height} width={width} />
        case IconsEnum.GraphqlIcon:
            return <GraphqlIcon fill={fill} height={height} width={width} />
        case IconsEnum.MongoDBIcon:
            return <MongoDBIcon fill={fill} height={height} width={width} />
        case IconsEnum.NetjsIcon:
            return <NetjsIcon fill={fill} height={height} width={width} />
        case IconsEnum.NodeIcon:
            return <NodeIcon fill={fill} height={height} width={width} />
        case IconsEnum.ReactIcon:
            return <ReactIcon fill={fill} height={height} width={width} />
        case IconsEnum.TypescriptIcon:
            return <TypescriptIcon fill={fill} height={height} width={width} fill2={fill2} />
        case IconsEnum.I18nIcon:
            return <I18nIcon fill={fill} height={height} width={width} />
        case IconsEnum.FireBaseIcon:
            return <FireBaseIcon fill={fill} height={height} width={width} />
        case IconsEnum.NestJSIcon:
            return <NestJSIcon fill={fill} height={height} width={width} />
        case IconsEnum.MaterialUiIcon:
            return <MaterialUiIcon fill={fill} height={height} width={width} />
        case IconsEnum.ThreeJSIcon:
            return <ThreeJSIcon fill={fill} fill2={fill2} height={height} width={width} />
        case IconsEnum.TalwindIcon:
            return <TalwindIcon fill={fill} fill2={fill2} height={height} width={width} />
        case IconsEnum.EthersJsIcon:
            return <EthersJsIcon fill={fill} fill2={fill2} height={height} width={width} />
        case IconsEnum.FramerMotionIcon:
            return <FramerMotionIcon fill={fill} fill2={fill2} height={height} width={width} />
        case IconsEnum.HardHatIcon:
            return <HardHatIcon fill={fill} fill2={fill2} height={height} width={width} />
        case IconsEnum.WalletConnectIcon:
            return <WalletConnectIcon fill={fill} fill2={fill2} height={height} width={width} />
        case IconsEnum.Email:
            return <EmailIcon fill={fill} fill2={fill2} height={height} width={width} />;
        case IconsEnum.GitHub:
            return <GitHubIcon fill={fill} fill2={fill2} height={height} width={width} />;
        case IconsEnum.Linkedin:
            return <LinkedinIcon fill={fill} fill2={fill2} height={height} width={width} />
        case IconsEnum.Engine:
            return <EngineIcon fill={fill} fill2={fill2} height={height} width={width}/>
        case IconsEnum.Mobile:
            return <MobileIcon fill={fill} fill2={fill2} height={height} width={width}/>
        case IconsEnum.WebApps:
            return <WebAppsIcon fill={fill} fill2={fill2} height={height} width={width}/>;
        default:
            return null;

    }
}